    var maxScan = countbytes - 11;
    var libKernelBaseRef = window.libKernelBase;
    var syscallsRef = window.syscalls;
    
    // Cache pattern constants
    var PATTERN_BYTE_0 = 0x48, PATTERN_BYTE_1 = 0xc7, PATTERN_BYTE_2 = 0xc0;
