    var returnvalue;

    // Cache frequently used gadgets and functions
    var cachedGadgets = window.gadgets;
    var popRdiGadget = cachedGadgets["pop rdi"];
    var movRaxGadget = cachedGadgets["mov [rdi], rax"];
